Step-by-step reasoning:
1. Key Psychological Mechanisms: We assume that responders’ evaluation of an offer depends on the amount offered (split_self) compared to what they perceive as “fair.” Fairness is based on the relative contribution (token_self) to the group’s total tokens (token_self + token_opp) multiplied by the total money available (combined_earning). In addition, responders may reward offers that exceed their fairness expectation and penalize those that fall short—but the sensitivity to good offers may differ from the sensitivity to bad ones.
2. Interaction of Mechanisms: We first establish a fairness benchmark, f = (token_self/(token_self+token_opp)) × combined_earning. Then we compare the offered share (split_self) to f by taking their logarithmic ratio. A logarithmic transformation (i.e., Δ = ln(split_self/f)) serves two purposes: it makes the fairness deviation dimensionless and captures proportional differences, and it produces a natural zero when the offer is exactly fair (split_self = f). When the offer is greater than fair (Δ ≥ 0), we add a bonus scaled by a sensitivity parameter (eta). Conversely, when the offer is less than fair (Δ < 0), we subtract a penalty scaled by another sensitivity parameter (lambda). This way, the same monetary offer is valued more if it is “above fair” and less if “below fair.”
3. Mathematical Form: The final utility is defined by adding the offered amount split_self (which captures self-interest) to a bonus or penalty term that involves f (the fairness benchmark), the scaled logarithmic deviation, and a parameter (eta for bonus, lambda for penalty).
4. Learnable Parameters: Two free parameters are introduced: eta for the “bonus” effect when the offer exceeds the fairness reference and lambda for the “penalty” effect when the offer is below the fairness reference. Their finite numerical bounds will be generous but finite.
5. Mapping to Behavior: The model predicts that a responder will tend to accept offers with higher utility. If split_self is exactly at the fair level, the bonus/penalty term is zero. Offers above fairness yield positive bonus and thus increased utility, while those below fairness incur a penalty, lowering utility. These effects are scaled by the fairness level (f), so the overall impact is proportional to the stakes of the trial.

The formal model is given below.

<MODEL>
Let f = (token_self/(token_self+token_opp)) × combined_earning  
Let Δ = ln(split_self/f)  
U_accept = split_self + { eta × f × Δ   if Δ ≥ 0  
                          - lambda × f × |Δ|   if Δ < 0 }
</MODEL>

